function ProSingle() {
  return (
    <div className="flex flex-col bg-green-500 h-full w-1/2 rounded">
      <div className="text-center bg-slate-500">
        <h1 className="text-4xl text-white items-start">Pros</h1>
      </div>
    </div>
  );
}

export default ProSingle;
